css:
@namespace url(http://www.w3.org/1999/xhtml);

/*
    20090807:
        border-radius
    20090715:
        change a lighter logo
*/

@-moz-document domain("mobile01.com") {

body {
    background: #333333 !important;
}

a {
    color: #cccccc !important;
}

a:visited {
    color: #99cc66 !important;
}

/* header */
div.header_layout {
    background: #333333 !important;
}

/* header bar */
div.block_usermenu,
/* forum nav */
div.block_nav_content,
/* footer */
div.footer-rc_content
{
    background: #000000 !important;
    border-style: solid !important;
    border-color: #aaaaaa !important;
    margin-top: .5em !important;
    margin-bottom: .5em !important;
    -moz-border-radius: .5em !important;
}

b.block_rc,
b.footer-rc {
    display: none !important;
}

/* some global element */
input,
select {
    background: #444444 !important;
    color: #cccccc !important;
}

/* ad? */
div.textimg_header,
div.textimg_content,
div.textimg_item {
    background-color: #333333 !important;
    color: #cccccc !important;
}
b.textimg_block {
    display: none !important;
}

/* table corner */
div.tl,
div.tr,
div.bl,
div.br
{
    background: #333333 !important;
}
div.tl {
    border-style: solid !important;
    border-color: #aaaaaa !important;
    margin-top: .5em !important;
    margin-bottom: .5em !important;
    -moz-border-radius: .5em !important;
}

/* missing element */
div.topic_header_name {
    color: #cccccc !important;
}
a.bk12u {
    text-decoration: none !important;
}
div.page_info {
    color: #cccccc !important;
    margin-bottom: 1em !important;
}
div.page_link_b {
    color: #cccccc !important;
    margin-bottom: 1em !important;
}
div.forum_menu {
    color: #cccccc !important;
    margin-bottom: 1em !important;
}



/** post **/
/* top nav */
div.page_nav {
    color: #cccccc !important;
}

/* title */
span.rb16 {
    color: #cc3333 !important;
}


div.post_content {
    color: #cccccc !important;
}
div.user_info {
    color: #99cc66 !important;
}


blockquote {
    background: #555555 !important;
}


/* create post */
div.table_block_header_title,
div.table_block_row * {
    color: #cccccc !important;
    background: #333333 !important;
}

/* logo */
img[src="http://attach2.mobile01.com/images/mobile01.gif"]
{
    background: url("data:image/png;base64,") !important;
    background-repeat: no-repeat !important;
    width: 0 !important;
    height: 80px !important;
    padding-right: 245px !important;
}



}
